/* ONE dark UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.timecop {
  overflow: auto;
}
.timecop .timecop-panel {
  background-color: #2e2f2a;
}
.timecop .panels {
  display: flex;
  flex-direction: row;
}
.timecop .package-panel {
  display: flex;
  flex-direction: row;
  flex: 1;
}
.timecop .package-panel .list-group {
  overflow: hidden;
}
.timecop .package-panel .inset-panel {
  width: 100%;
}
.timecop .text-info {
  margin-bottom: 10px;
}
.timecop .timing,
.timecop .list-item {
  display: flex;
  justify-content: space-between;
}
.timecop .timing .inline-block:last-child,
.timecop .list-item .inline-block:last-child {
  margin-right: 0;
}
.timecop .timing {
  margin-bottom: 10px;
}
.timecop .list-item {
  margin-top: 5px;
  margin-bottom: 5px;
}
.timecop .package {
  color: #acaea3;
}
.timecop .package:hover {
  text-decoration: none;
  color: #ffffff;
}
.timecop .timecop-line {
  flex: 1 1 0;
  margin-right: 10px;
  margin-top: .80em;
  border-top: 1px dashed rgba(172, 174, 163, 0.2);
}
.timecop .package:hover + .timecop-line {
  border-color: rgba(172, 174, 163, 0.6);
}
